import React, { Component } from "react";
import styled from 'styled-components';

const PrettyHome = styled('div')`
    margin: 0 auto;
    width: 50%;
    text-align: center;
    height: 100vh;
    margin-top: 150px;
    border: 1px solid black;
`;


class Home extends Component {
    render() {
        return (
            <PrettyHome>
             hello world this is the home page
            </PrettyHome>
        )
    }
}

export default Home;
